void gen_trie_rus (void) {
#define ADD(x, y) add (y, type_ ## x, sizeof (type_ ## x) / sizeof (char*), x);
  root_ru = mn++;
  root_ru_part = mn++;
  ADD(1, root_ru);
  ADD(2, root_ru);
  ADD(4, root_ru);
  ADD(5, root_ru_part);
  ADD(6, root_ru_part);
  ADD(7, root_ru);
  ADD(8, root_ru);
  ADD(10, root_ru);
#undef ADD
}

void gen_vowels_rus (void) {
  int i;
  for (i = 0; _vowels_rus[i]; i++) {
    vowels_rus[conv_rus_win1251(_vowels_rus[i])] = 1;
  }
}

