int stem_rus_win1251 (const char *s, int len, char *res, int use_dictionary) {
  int n;
  for (n = 0; n < len && s[n] && n + 100 < maxn; n++) {
    stem_ts[n] = conv_rus_win1251 (s[n]);
  }
  int l = stem_rus (n, use_dictionary);
  for (n = 0; n < l; n++) {
    res[n] = (stem_ts[n] == 32 ? s[n] : stem_ts[n] + 'à');
  }
  res[n] = 0;
  return n;
}

int stem_rus_utf8 (const char *s, char *res, int use_dictionary) {
  int i;
  string_to_utf8 ((unsigned char *)s, stem_ts_v);
  for (i = 0; stem_ts[i] && i + 100 < maxn; i++) {
    stem_ts[i] = conv_rus_utf8 (stem_ts_v[i]);
  }
  int l = stem_rus (i, use_dictionary);
  for (i = 0; i < l; i++) {
    if (stem_ts[i] != 32) {
      stem_ts_v[i] = stem_ts[i] + 1072;
    }
  }
  stem_ts_v[l] = 0;
  put_string_utf8 (stem_ts_v, res);
  return l;
}

int stem_rus_utf8i (int *v, int use_dictionary) {
  int i;
  for (i = 0; v[i] && i + 100 < maxn; i++) {
    stem_ts[i] = conv_rus_utf8 (v[i]);
  }
  int l = stem_rus (i, use_dictionary);
  for (i = 0; i < l; i++) {
    if (stem_ts[i] != 32) {
      v[i] = stem_ts[i] + 1072;
    }
  }
  v[l] = 0;
  return l;
}

